import classes from "./TodoItem.module.css";

const TodoItem: React.FC<{ text: string }> = (props) => {
  return (
    <li className={classes.item}>
      <span className={classes.text}>{props.text}</span>Delete Todo
    </li>
  );
};

export default TodoItem;
